import React, { useState } from "react";

function onchanger (){
    let [text, setText] = useState(" ")

    function onch(event) {
        const t = event.target.value
        setText = (t)
    }



    return(
        <div>
            <br></br>
            <input type="text"></input>
            <button onchanger = {onch}> ok </button>
            <ul>
                <li>{text}</li>
            </ul>
        </div>
        
        
    )

}


export default onchanger;
